import { useState } from 'react';
import SkillBar from './SkillBar';
import {Card} from '@mui/material';
import {ResponsiveContainer,PieChart, Pie,Cell, Tooltip} from 'recharts';


export default function Dashboard() {

    const PIE_COLORS = ["#49416D","#A882DD","#E08D79","#E0EFDE","#01A7C2"];
    const exp_data = [
        {
            "skill": "ETL/ELT",
            "exp": 4
        },
        {
            "skill": "Python",
            "exp": 3
        },
        {
            "skill": "SQL",
            "exp": 4,

        },
        {
            "skill": "Generative-AI",
            "exp": 1
        },
        {
            "skill": "Machine Learning",
            "exp": 2
        }
    ]



    return (
        <div
            className="dash-container"
            style={{
                display:"flex"
            }}
        >
            <Card>
                <SkillBar />
            </Card>

            <Card
                className="skill-exp-pie"
                >
                <ResponsiveContainer width="100%" height={400}>
                <PieChart width={300} height={300} >
                        <Tooltip />
                        <Pie data={exp_data} dataKey="exp" nameKey="skill" fill='#55828B' >
                        {exp_data.map((entry, index) => <Cell fill={PIE_COLORS[index % PIE_COLORS.length]}/>)}
                        </Pie>
                    </PieChart>

                </ResponsiveContainer>


            </Card>


</div>
    );
}
